DIÁRIO OFICIAL DA UNIÃO
Publicado em: 20/12/2022
Edição: 238
Seção: 1    Página: 4

Órgão:
Presidência da República/Advocacia-Geral da União

PORTARIA NORMATIVA AGU Nº 74, DE 16 DE DEZEMBRO DE 2022

Aprova o Regimento Interno da Consultoria Jurídica Junto ao Ministério da Defesa e das Consultorias Jurídicas-Adjuntas junto aos Comandos da Marinha, do Exército e da Aeronáutica.

O ADVOGADO-GERAL DA UNIÃO, no uso das atribuições que lhe confere o art. 4º,caput, incisos XIV e XVIII, da Lei Complementar nº 73, de 10 de fevereiro de 1993, e tendo em vista o disposto no art. 2º,caput, inciso II, alínea "b", e no art. 45, § 1º, ambos da Lei Complementar nº 73, de 1993, e no art. 25, do Anexo I do Decreto nº 11.174, de 16 de agosto de 2022, e do que consta do Processo Administrativo nº 00731.000389/2022-52, resolve:

Art. 1º Fica aprovado o Regimento Interno da Consultoria Jurídica junto ao Ministério da Defesa e das Consultorias Jurídicas-Adjuntas junto aos Comandos da Marinha, do Exército e da Aeronáutica, na forma do Anexo a esta Portaria Normativa.

Art. 2º Fica revogado o Ato Regimental nº 6, de 19 de junho de 2002.

Art. 3º Esta Portaria Normativa entra em vigor na data de sua publicação.

BRUNO BIANCO LEAL

ANEXO

REGIMENTO INTERNO DA CONSULTORIA JURÍDICA JUNTO AO MINISTÉRIO DA DEFESA E DAS CONSULTORIAS JURÍDICAS-ADJUNTAS JUNTO AOS COMANDOS DA MARINHA, DO EXÉRCITO E DA AERONÁUTICA

CAPÍTULO I

DA CONSULTORIA JURÍDICA JUNTO AO MINISTÉRIO DA DEFESA

Seção I

Da Categoria e competência

Art. 1º À Consultoria Jurídica junto ao Ministério da Defesa, órgão de execução da Advocacia-Geral da União, nos termos do art. 2º, inciso II, alínea "b", da Lei Complementar nº 73, de 10 de fevereiro de 1993, compete:

I - prestar assessoria e consultoria jurídica no âmbito do Ministério da Defesa;

II - fixar a interpretação da Constituição, das leis, dos tratados e dos demais atos normativos, a ser uniformemente seguida na área de atuação do Ministério quando não houver orientação normativa do Advogado-Geral da União;

III - uniformizar as teses jurídicas em relação às matérias comuns às Consultorias Jurídicas-Adjuntas junto aos três Comandos, nos termos do art. 8º-G, caput e § 1º, da Lei nº 9.028, de 12 de abril de 1995;

IV - atuar, em conjunto com os órgãos técnicos do Ministério, na elaboração de propostas de atos normativos a serem submetidas ao Ministro de Estado;

V - exercer a coordenação dos órgãos jurídicos das entidades vinculadas ao Ministério da Defesa no âmbito da competência geral prevista no art. 8º-G,capute § 1º, da Lei nº 9.028, de 1995;

VI - realizar revisão final da técnica legislativa e emitir parecer conclusivo sobre a constitucionalidade, a legalidade e a compatibilidade com o ordenamento jurídico das propostas de atos normativos;

VII - assistir o Ministro de Estado no controle interno da legalidade administrativa dos atos do Ministério e das entidades a ele vinculadas;

VIII - fornecer subsídios para atuação dos demais órgãos jurídicos integrantes da Advocacia-Geral da União em assuntos de competência do Ministério da Defesa;

IX - realizar atividades conciliatórias, respeitadas as orientações dos órgãos de direção superior da Advocacia-Geral da União e a competência da Consultoria-Geral da União;

X - atuar na representação extrajudicial do Ministério da Defesa e dos agentes públicos, respeitadas as orientações dos órgãos de direção superior da Advocacia-Geral da União e a competência dos demais órgãos jurídicos da Advocacia-Geral da União;

XI - zelar pelo cumprimento e observância das orientações emanadas dos órgãos de direção superior da Advocacia-Geral da União;

XII - examinar, prévia e conclusivamente, no âmbito do Ministério da Defesa, por meio de sua estrutura própria:

a) os textos de edital de licitação e dos respectivos contratos ou instrumentos congêneres, a serem publicados e celebrados; e

b) os atos pelos quais se reconheça a inexigibi
